(45, '网站顶部html', 'custom_html', 'a:3:{s:5:"zh-CN";s:520:"<div class="jumbotron margin-bootom-0 hidden-xs img-bg-01"> <div class="container">  <div class="media col-sm-12">    <div class="media-body">     <p><span xss="removed">将来的很长一段时间，我会把精力放在写文档上。</span>现在关注我们的人虽然不多，但也有近百人了，我希望尽快让更多的人加入进来,并且始终以<span xss=removed>GPL3</span><span xss=removed>许可证</span><span xss=removed>开源</span><span xss=removed>。</span></p></div>   </div>   </div></div>";s:2:"en";s:725:"<div class="jumbotron margin-bootom-0 hidden-xs img-bg-01"> <div class="container">  <div class="media col-sm-12">    <div class="media-body">     <h5>About Openant</h5>\r\nAre you despised ecshop commercial license? Resentment over whether the business school encrypted code? Or you endured opencart not well supported by more businesses? Or is opencart no development documentation? Or magento framework too? Are you already in the obscenity of one day the birth of a free and powerful burst of electricity supplier to the project? Then your long absence OpenAnt come, it is completely free commercial license, in order to promote the development of foreign trade electricity supplier.<br></div>\r\n   </div>\r\n   </div>\r\n</div>";s:6:"status";s:1:"1";}', 0),
