INSERT INTO `product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`) VALUES
(52, 1, '蓝月亮洗衣液套装 薰衣草机洗白兰手洗专用4瓶3袋装亮白官方正品', '<p><span xss="removed">If your commodity weight equal to about 5 kg, <img src="/image/users/2016/03/18/9/description/20160806110832ZyoDRXfkTN.jpg">you can choose this for your product distribution services, it will be your most cost-effective choice, we have done everything for you, use this payment to us, man!</span><br></p>', '', '', '蓝月亮洗衣液套装 薰衣草机洗白兰手洗专用4瓶3袋装亮白官方正品'),
(52, 2, '6kg商品快递单', '<p>如果你的商品重量约等于5公斤，你可以选择这个商品为你的配送服务<img src="/image/users/2016/03/18/9/description/20160806110852PXTlZmbeGn.jpg">，它将是你最划算的选择，我们已经为你做好了一切,用这个方式付款给我们吧，伙计!<br></p>', '', '', ''),
(54, 1, '王老吉正宗凉茶植物饮料310ml*24罐怕上火认准正宗王老吉批发包邮', '<p class="12366" xss="removed"><span xss="removed">如果你的商品重量约等于5公斤，你可以选择这个商品为你的配送服务，它将是你最划算的选择，我们已经为你做好了一切,用这个方式付款给我<img src="resources/image/users/2016/02/02/1/XNA69wMKI5mdf02D.png">们吧，伙计!</span></p>', '', '', '王老吉正宗凉茶植物饮料310ml*24罐怕上火认准正宗王老吉批发包邮'),
(76, 1, '精选纯正 雪花啤酒整箱勇闯天涯500mlx24听装灌装啤酒批发整箱', '<p><img src="/image/users/2016/02/02/1/description/201608061108538cSnTRNMpK.jpg"><br></p>', '', '', '精选纯正 雪花啤酒整箱勇闯天涯500mlx24听装灌装啤酒批发整箱'),
(73, 1, '可口可乐公司 小瓶可乐迷你装碳酸饮料300ml*24瓶 江浙沪皖包邮', '<p>5月10日早晨，上班高峰期，广州雷阵雨局部大雨，雷雨时阵风7<img src="/image/users/2016/02/02/1/description/201608061108538cSnTRNMpK.jpg">级左右。广州市区多处被水淹，雨水倒灌进地铁站，地铁一度变成地下河。<br></p>', '', '', '可口可乐公司 小瓶可乐迷你装碳酸饮料300ml*24瓶 江浙沪皖包邮'),
(73, 2, 'May 10 morning rush hour, Guangzhou thunderstorms locally heavy rain, thunderstorm gust around seven. Guangzhou city many were flooded, water intrusion into the subway station, subway once into the underground river.', '<p>May 10 morning rush hour, Guangzhou thunderstorms locally <img src="/image/users/2016/02/02/1/description/20160806110819QLpFgwvRyB.jpg">heavy rain, thunderstorm gust around seven. Guangzhou city many were flooded, water intrusion into the subway station, subway once into the underground river.<br></p>', '', '', 'May 10 morning rush hour, Guangzhou thunderstorms locally heavy rain, thunderstorm gust around seven. Guangzhou city many were flooded, water intrusion into the subway station, subway once into the underground river.'),
(72, 1, '崂山啤酒 五厂 崂山沙子口泉水酿造 500ml*12/箱 部分地区2箱包邮', '<p xss="removed">【环球网综合报道】据香港《东方日报》5月9日报道，美国西点军校学员毕业时，有模仿经典历史肖像拍照的传统，而今年16名即将毕业的黑人女学员就拍了一张举起拳头的毕业照。照片惹起社会争议，有人认为此举有违国防部政策，而西点军校已经展开调查。</p><p xss="removed">　　据报道，涉事的16名学员将<img src="/image/users/2016/02/02/1/description/201608061108538cSnTRNMpK.jpg">于本月21日毕业，她们穿上灰色军服，举起右手拳头，站在宿舍楼梯上拍照。照片被上传网络后，有人质疑她们举起拳头是否是为支持近年因一连串美警涉对黑人滥用武力案而兴起的黑人运动“Black Lives Matter”，因此涉嫌违反国防部“执勤时不能参与政治活动”的规条。</p><p xss="removed">　　在本事件惹起社会广泛讨论后，西点军校发言人前日表示学校已经介入调查，目前尚不清楚调查所需时间，以及对涉事学员可能作出的惩罚。</p><p xss="removed">　　认识涉事学员的毕业生杜宾(Mary Tobin)认为，她们此举只是展示团结的方式，无意涉及黑人运动，纯粹在庆祝成功毕业，在似运动队获胜后会抛起头盔一样。</p><p xss="removed">　　据了解，西点军校内7成学员是白人，8成是男性，黑人女学员为数不多。(实习编辑：朱丽娜 审核：谭利娅)</p>', '', '', '崂山啤酒 五厂 崂山沙子口泉水酿造 500ml*12/箱 部分地区2箱包邮'),
(72, 2, '【环球网综合报道】据香港《东方日报》5月9日报道，美国西点军校学员毕业时，有模仿经典历史肖像拍照的传统，而今年1', '<p xss="removed">【环球网综合报道】据香港《东方日报》5月9日报道，美国西点军校学员毕业时，有模仿经典历史肖像拍照的传统，而今年16名即将毕业的黑人女学员就拍了一张举起拳头的毕业照。照片惹起社会争议，有人认为此举有违国防部政策，而西点军校已经展开调查。</p><p xss="removed">　　据报道，涉事的16名学员将于本月21日毕业，她们穿上灰色军服，举起右手拳头，站在宿舍楼梯上拍照。照片被上传网络后，有人质疑她们举起拳头是否是为支持近年因一连串美警涉对黑人滥用武力案而兴起的黑人运动“Black Lives Matter”，因此涉嫌违反国防部“执勤时不能参与政治活动”的规条。</p><p xss="removed">　　在本事件惹起社会广泛讨论后，西点军校发言人前日表示学校已经介入调查，目前尚不清楚调查所需时间，以及对涉事学员可能作出的惩罚。</p><p xss="removed">　　认识涉事学员的毕业生杜宾(Mary Tobin)认为，她们此举只是展示团结的方式，无意<img src="/image/users/2016/02/02/1/description/20160806110826LOdKA7x2Hg.jpg">涉及黑人运动，纯粹在庆祝成功毕业，在似运动队获胜后会抛起头盔一样。</p><p xss="removed">　　据了解，西点军校内7成学员是白人，8成是男性，黑人女学员为数不多。(实习编辑：朱丽娜 审核：谭利娅)</p>', '', '', '【环球网综合报道】据香港《东方日报》5月9日报道，美国西点军校学员毕业时，有模仿经典历史肖像拍照的传统，而今年1'),
